const COLOR_GRAY = 'gray-500';
const COLOR_RED = 'red-500';
const COLOR_YELLOW = 'yellow-500';
const COLOR_GREEN = 'green-500';
const COLOR_INDIGO = 'indigo-500';


function setSummary(name, color) {
	const total = name === 'violations' ?
	results[name].reduce((acc, item) => acc + item.nodes.length, 0) :
	results[name].length;

	const eleSummary = document.getElementById(`summary-${name}`);
	const eleCount = eleSummary.querySelector('span');
	const eleSVG = eleSummary.querySelector('svg');
	eleCount.textContent = total;

	if(total > 0) {
		eleCount.classList.remove(`text-${COLOR_GRAY}`);
		eleSVG.classList.remove(`text-${COLOR_GRAY}`);
		eleCount.classList.add(`text-${color}`);
		eleSVG.classList.add(`text-${color}`);
	}
}

function getRecommendations(array, msg) {
	const divMessage = document.createElement('div');
	divMessage.className = 'flex items-center gap-2';

	const pMessage = document.createElement('p');
	pMessage.className = 'text-xs flex-1';
	pMessage.textContent = msg
	divMessage.appendChild(pMessage);

	const ul = document.createElement('ul');
	ul.className = 'list-disc list-outside flex-1';
	array.forEach(check => {
		const li = document.createElement('li');
		li.className = 'text-xs text-wrap';
		li.textContent = check.message;
		ul.appendChild(li);
	});

	divMessage.appendChild(ul);
	return divMessage
}

setSummary('violations', COLOR_RED);
setSummary('incomplete', COLOR_YELLOW);
setSummary('passes', COLOR_GREEN);
setSummary('inapplicable', COLOR_INDIGO);

// ----------------
function togglePanel(buttonId, panelId) {
	const button = document.getElementById(buttonId);
	const panel = document.getElementById(panelId);
	button.addEventListener('click', () => {
			const isPanelHidden = panel.style.display === 'none' || panel.style.display === '';
			panel.style.display = isPanelHidden ? 'block' : 'none';
			button.getElementsByTagName('svg')[0].classList.toggle('rotate-180', isPanelHidden);
	});
}

togglePanel('btn-violations', 'panelViolations');
togglePanel('btn-incomplete', 'panelIncomplete');
togglePanel('btn-passes', 'panelPasses');
togglePanel('btn-inapplicable', 'panelInapplicable');

function renderDetails({name, msgs}) {
	const divResults = document.getElementById(name)
	let idxResults = 1;
	results[name].forEach(item => {
		// Insert the Category
		const divCategory = document.createElement('div');
		divCategory.className = 'flex justify-between items-center border px-4 py-2';

		const titleCategory = document.createElement('h3');
		titleCategory.className = 'text-lg font-semibold pr-2';
		titleCategory.textContent = item.help;
		divCategory.appendChild(titleCategory);

		const impact = document.createElement('span');
		impact.className = 'bg-red-800 text-white text-xs font-semibold rounded-full px-2';
		impact.textContent = item.impact;
		divCategory.appendChild(impact);

		divResults.appendChild(divCategory);

		// Then insert the container for description, tags and items.
		// Let's create the container first.
		const divContainer = document.createElement('div');
		divContainer.className = 'flex flex-col p-4 gap-4 border mb-4';

		// Create the div for placing the id and tags.
		const divIdTags = document.createElement('div');
		divIdTags.className = 'flex flex-wrap gap-2';

		const catId = document.createElement('p');
		catId.className = 'font-semibold text-zinc-500 text-xs';
		catId.textContent = item.id;
		divIdTags.appendChild(catId); // Add the id to the div

		// Let's iterate the spans and placed into the div
		item.tags.forEach(tag => {
			const spanTag = document.createElement('span');
			spanTag.className = 'font-semibold text-xs text-white bg-zinc-500 rounded-md px-1';
			spanTag.textContent = tag;
			divIdTags.appendChild(spanTag);
		});

		// Create the description element
		const description = document.createElement('p');
		description.className = 'text-xs';
		description.textContent = item.description;

		// Almost there. Create the 'issues' container
		const divElements = document.createElement('div');
		divElements.className = 'flex flex-col w-full border px-2';

		// Finally, insert the elements into the container:
		divContainer.appendChild(divIdTags);
		divContainer.appendChild(description);
		divContainer.appendChild(divElements);
		// and the main div
		divResults.appendChild(divContainer)

		item.nodes.forEach((node, idx) => {
			const div = document.createElement("div");
			const classBorder = idx === item.nodes.length-1 ? 'border-0' : 'border-b';
			div.classList.add("flex", "items-center", 'py-2', classBorder);

			// Crear el span para el número
			const span = document.createElement("span");
			span.textContent = idxResults++; // Usar el índice + 1 como número
			div.appendChild(span);

			const divDetails = document.createElement('div');
			divDetails.className = 'flex flex-1 flex-col ml-4 gap-2'
			div.appendChild(divDetails)

			const divLocation = document.createElement('div')
			divLocation.className = 'flex items-center gap-2'
			divDetails.appendChild(divLocation);

			const pLocation = document.createElement('p');
			pLocation.className = 'text-xs'
			pLocation.textContent = 'Element Location:'
			divLocation.appendChild(pLocation);

			const preLocation = document.createElement('pre');
			preLocation.className = 'flex-1';
			const codeLocation = document.createElement('code')
			codeLocation.className = 'text-xs whitespace-normal p-2 rounded-md language-css';
			codeLocation.textContent = node.target.join(' && ');
			preLocation.appendChild(codeLocation);
			divLocation.appendChild(preLocation);

			// Crear el elemento <pre>
			const pre = document.createElement('pre');

			// Crear el elemento <code>
			const code = document.createElement("code");
			code.classList.add("text-xs", "whitespace-normal", "p-2", "rounded-md", "language-xml");
			code.textContent = node.html; // Asignar el texto del código
			pre.appendChild(code)
			divDetails.appendChild(pre);


			if(node.any.length > 0) {
				const divMessage = getRecommendations(node.any, msgs.any);
				divDetails.appendChild(divMessage);
			}

			if(node.all.length > 0) {
				const divMessage = getRecommendations(node.all, msgs.all);
				divDetails.appendChild(divMessage);
			}

			if(node.none.length > 0) {
				const divMessage = getRecommendations(node.none, msgs.none);
				divDetails.appendChild(divMessage);
			}


			// Añadir el div al contenedor principal
			divElements.appendChild(div);
		})
	});
}

